    return <Product/>
  };

  const onAddBtnClick = () => { 
    setProduct(product.concat(<AddProduct key={product.length} />));

 }

  return (
    <div className="App">
      <Form />
      <Product pro={aga}/>
      <button onClick={onAddBtnClick}>Add input</button>
    </div>
  );
}

export default App;
